import { createNativeStackNavigator } from '@react-navigation/native-stack';

import { AllCardsScreen } from '../screens/AllCardsScreen';
import { AuthZipScreen } from '../screens/Auth/AuthZipScreen';
import { AuthDOBScreen } from '../screens/Auth/AuthDOBScreen';
import { AuthPwdScreen } from '../screens/Auth/AuthPwdScreen';
import { SetupScreen } from '../screens/SetupScreen';
import { Basics_1_Screen } from '../screens/SelfGuided/Basics_1_Screen';
import { Basics_2_Screen } from '../screens/SelfGuided/Basics_2_Screen';
import { Basics_3_Screen } from '../screens/SelfGuided/Basics_3_Screen';
import { Basics_4_Screen } from '../screens/SelfGuided/Basics_4_Screen';
import { HomeScreen } from '../screens/HomeScreen';
import { InsightsScreen } from '../screens/InsightsScreen';
import { List } from './../screens/List';
import { ProfileScreen } from '../screens/ProfileScreen';
import { SessionsScreen } from '../screens/SessionsScreen';
import { SupportScreen } from '../screens/SupportScreen';



const Stack = createNativeStackNavigator();

export const Main = () => (
  <Stack.Navigator
    initialRouteName="List"
    screenOptions={{ headerShown: false }}
  >
    <Stack.Screen name="List" component={List} />
    <Stack.Screen name="AllCardsScreen" component={AllCardsScreen} />
    <Stack.Screen name="AuthZipScreen" component={AuthZipScreen} />
    <Stack.Screen name="AuthDOBScreen" component={AuthDOBScreen} />
    <Stack.Screen name="AuthPwdScreen" component={AuthPwdScreen} />
    <Stack.Screen name="SetupScreen" component={SetupScreen} />
    <Stack.Screen name="Basics_1_Screen" component={Basics_1_Screen} />
    <Stack.Screen name="Basics_2_Screen" component={Basics_2_Screen} />
    <Stack.Screen name="Basics_3_Screen" component={Basics_3_Screen} />
    <Stack.Screen name="Basics_4_Screen" component={Basics_4_Screen} />
    <Stack.Screen name="HomeScreen" component={HomeScreen} />
    <Stack.Screen name="InsightsScreen" component={InsightsScreen} />
    <Stack.Screen name="ProfileScreen" component={ProfileScreen} />
    <Stack.Screen name="SessionsScreen" component={SessionsScreen} />
    <Stack.Screen name="SupportScreen" component={SupportScreen} />
  </Stack.Navigator>
);
